webpackJsonp([0x99f9dfcdfebb2800],{"./node_modules/json-loader/index.js!./.cache/json/javascript-return-statements.json":function(n,s){n.exports={data:{markdownRemark:{html:'<h2>Introduction</h2>\n<p>When a <strong>return</strong> statement is called in a function, the execution of this function is stopped. If specified, a given value is returned to the function caller. If the expression is omitted, <code>undefined</code> is returned instead.</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code>    <span class="token keyword">return</span> expression<span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>Functions can return:</p>\n<ul>\n<li>Primitive values (string, number, boolean, etc.)</li>\n<li>Object types (arrays, objects, functions, etc.)</li>\n</ul>\n<h2>Examples</h2>\n<p>The following function returns the square of its argument, <strong>x</strong>, where <strong>x</strong> is a number.</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code>    <span class="token keyword">function</span> <span class="token function">square</span><span class="token punctuation">(</span>x<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n       <span class="token keyword">return</span> x <span class="token operator">*</span> x<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<p><img src="//forum.freecodecamp.com/images/emoji/emoji_one/rocket.png?v=2" title=":rocket:" alt=":rocket:" class="forum-image"> <a href=\'https://repl.it/C7VT/0\' target=\'_blank\' rel=\'nofollow\'>Run Code</a></p>\n<p>The following function returns the product of its arguments, <strong>arg1</strong> and <strong>arg2</strong>.</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code>    <span class="token keyword">function</span> <span class="token function">myfunction</span><span class="token punctuation">(</span>arg1<span class="token punctuation">,</span> arg2<span class="token punctuation">)</span><span class="token punctuation">{</span>\n       <span class="token keyword">var</span> r<span class="token punctuation">;</span>\n       r <span class="token operator">=</span> arg1 <span class="token operator">*</span> arg2<span class="token punctuation">;</span>\n       <span class="token keyword">return</span><span class="token punctuation">(</span>r<span class="token punctuation">)</span><span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<p><img src="//forum.freecodecamp.com/images/emoji/emoji_one/rocket.png?v=2" title=":rocket:" alt=":rocket:" class="forum-image"> <a href=\'https://repl.it/C7VU/0\' target=\'_blank\' rel=\'nofollow\'>Run Code</a></p>\n<p>When a function <code>return</code>s a value, the value can be assigned to a variable using the assigment operator (<code>=</code>). In the example below, the function returns the square of the argument. When the function resolves or ends, its value is the <code>return</code>ed value. The value is then assigned to the variable <code>squared2</code>.</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code>    <span class="token keyword">function</span> <span class="token function">square</span><span class="token punctuation">(</span>x<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n        <span class="token keyword">return</span> x <span class="token operator">*</span> x<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n    \n    <span class="token keyword">let</span> squared2 <span class="token operator">=</span> <span class="token function">square</span><span class="token punctuation">(</span><span class="token number">2</span><span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment" spellcheck="true">// 4</span>\n</code></pre>\n      </div>\n<p>If there is no explicit return statement, meaning the function is missing the <code>return</code> keyword, the function automatically returns <code>undefined</code>. In the following example, the <code>square</code> function is missing the <code>return</code> keyword. When the result of calling the function is assigned to a variable, the variable has a value of <code>undefined</code>.</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code>    <span class="token keyword">function</span> <span class="token function">square</span><span class="token punctuation">(</span>x<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n        <span class="token keyword">let</span> y <span class="token operator">=</span> x <span class="token operator">*</span> x<span class="token punctuation">;</span>\n    <span class="token punctuation">}</span>\n    \n    <span class="token keyword">let</span> squared2 <span class="token operator">=</span> <span class="token function">square</span><span class="token punctuation">(</span><span class="token number">2</span><span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment" spellcheck="true">// undefined</span>\n</code></pre>\n      </div>\n<p><img src="//forum.freecodecamp.com/images/emoji/emoji_one/rocket.png?v=2" title=":rocket:" alt=":rocket:" class="forum-image"> <a href=\'https://repl.it/M8BE\' target=\'_blank\' rel=\'nofollow\'>Run Code</a></p>\n<h4>More Information:</h4>\n<p><a href=\'https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Statements/return\' target=\'_blank\' rel=\'nofollow\'>MDN link</a></p>\n<p><a href=\'https://msdn.microsoft.com/en-us/library/22a685h9.aspx\' target=\'_blank\' rel=\'nofollow\'>MSDN link</a></p>',fields:{slug:"/javascript/return-statements/"},frontmatter:{title:"Return Statement"}}},pathContext:{slug:"/javascript/return-statements/"}}}});
